    false,nt"url": null,nt"notes": "NODC Accession 0116709 includes biological,
    chemical, discrete sample, physical and profile data collected from AIRCRAFT, ARCTIC
    IVIK, Amundsen, HENRY LARSEN, JOHN P. TULLY, LOUIS S. ST. LAURENT, PIERRE RADISSON,
    SIR WILFRID LAURIER and THETA in the Arctic Ocean, Baffin Bay, Beaufort Sea, Bering
    Sea, Coastal Waters of SE Alaska, Davis Strait, Gulf of Alaska, Gulf of St. Lawrence,
    Hudson Strait, Labrador Sea, North Pacific Ocean and Northwest Passage from 1974-08-11
    to 2009-10-15 and retrieved during cruise 34 cruises and IOS Arctic Database 1974-2009.
    These data include ALKALINITY, AMMONIUM, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON,
    DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, Delta Oxygen - 18, HYDROSTATIC PRESSURE,
    NITRATE, PARTICULATE ORGANIC CARBON, PARTICULATE ORGANIC NITROGEN, PHAEOPHYTIN,
    PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, Total Organic Carbon
    (TOC), WATER TEMPERATURE, pH and suspended solids. The instruments used to collect
    these data include CTD and bottle. These data were collected by Lisa A. Miller and
    C. S. Wong of Institute of Ocean Sciences - Sidney and Karina E. Giesbrecht of University
    of Victoria - British Columbia; School of Earch and Ocean Sciences as part of the
    IOS_Arctic_Database data set.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
